import { createApp } from 'vue';
import { createRouter, createWebHistory } from "vue-router";
import App from './App.vue';
import HeadderTop from './components/HeadderTop.vue';
import CoTrang from './view/PhimCoTrang.vue';
import HanhDong from './view/PhimHanhDong.vue';
import HoatHinh from './view/PhimHoatHinh.vue';
import KinhDi from './view/PhimKinhDi.vue';
import TinhCam from './view/PhimTinhCam.vue';
import PhimAll from './view/PhimAll.vue';
const router = createRouter({
  history: createWebHistory(),
  routes: [{
    path: '/CoTrang',
    component: CoTrang
  }, {
    path: '/HanhDong',
    component: HanhDong
  }, {
    path: '/HoatHinh',
    component: HoatHinh
  }, {
    path: '/KinhDi',
    component: KinhDi
  }, {
    path: '/TinhCam',
    component: TinhCam
  }, {
    path: '/',
    component: PhimAll
  }]
});
const app = createApp(App);
app.component('HeadderTop', HeadderTop);
app.mount('#app');
app.use(router);
